import React, { useEffect, useState } from 'react'
import Router, { Navigate, useNavigate } from 'react-router-dom'
import './css/StudentList.css'
import axios from 'axios'

function StudentList({data}) {
  const [loading, setLoading] = useState(true)
  const [datalist, setdatalist] = useState([])
  const navigate = useNavigate ()
  
  const getData = async () =>{
    await axios.post('http://localhost:8085/api/getresults', data)
    .then((res)=>{
      console.log(res.data)
      if(res.data.message == 'notLoggedin'){
        //navigate('/')
      }
      else{
        setLoading(false)
        setdatalist([...datalist, ...res.data]) 
      }
    })
    .catch((err) =>{console.log(err.message)})
  }

  useEffect(()=>{
    getData()
    setLoading(true)
  },[])

  return (
    <div className='outer-outer-div'>
      <div className='outer-div'>
        {
          loading ? '' :
          datalist.map((item) => {console.log(item)})
        }
        <a href='google.com'>
        <div className='inner-div'>
          <h2>OMKAR ANAND KAMBLE</h2>
          <h3>SEM-VIII</h3>
          <h3>12345678</h3>
        </div>  
        </a>
        
      </div>      
    </div>
    
  )
}

export default StudentList
